                                        id="direccion_destino" name="direccion_destino"
                                        onChange={event => handleInputChange(event, 15)}></Field>
                                </div>
                            </div>

                            {/* 16. DEPARTAMENTO*/}
                            <div className="col-md-5">
                                <div className="form-group">
                                    <label htmlFor="departamento_origen">Departamento</label>
