    const enviarDatos = (datos) => {
        window.showSpinner(true);
        let data;

        data = {
            "data": {
                "type": 'migracion-datos-interesado',
                "attributes": {
                    "tipo_interesado": datos.tipo_interesado,
                    "tipo_sujeto_procesal": datos.tipo_sujeto_procesal,
                    "primer_nombre": datos.primer_nombre,
                    "segundo_nombre": datos.segundo_nombre,
                    "primer_apellido": datos.primer_apellido,
                    "segundo_apellido": datos.segundo_apellido,
                    "tipo_documento": datos.tipo_documento,
                    "numero_documento": datos.numero_documento,
                    "email": datos.email,
                    "telefono": datos.telefono,
                    "telefono2": datos.telefono2,
                    "cargo": datos.cargo,
                    "orientacion_sexual": datos.orientacion_sexual,
                    "sexo": datos.sexo,
                    "direccion": datos.direccion,
                    "departamento": datos.departamento,
                    "ciudad": datos.ciudad,
                    "localidad": datos.localidad,
                    "entidad": datos.entidad,
                    "sector": datos.sector,
                    "radicado": props.getParametros.radicado,
                    "vigencia": props.getParametros.vigencia,
                    "item": props.getParametros.item,
                }
            }
        }

        GenericApi.addGeneric("migrar-interesados", data).then(
            datos => {
                if (!datos.error) {
                    setModalState({ title: "SINPROC No " + props.getParametros.radicado + " :: Crear interesado", message: 'Registro Exitoso', show: true, redirect: `/ProcesoDisciplinarioMigracion/${props.getParametros.radicado}/${props.getParametros.vigencia}`, alert: global.Constants.TIPO_ALERTA.EXITO });
                }
                else {
                    setModalState({ title: "SINPROC No " + props.getParametros.radicado + " :: Crear interesado", message: datos.error.toString(), show: true, redirect: `/ProcesoDisciplinarioMigracion/${props.getParametros.radicado}/${props.getParametros.vigencia}`, alert: global.Constants.TIPO_ALERTA.ERROR });
                }
                window.showSpinner(false);

            }
        )
    }

    return (
        <>
            {<Spinner />}
            {<ModalGen data={getModalState} />}

            <Formik
                initialValues={{
                    tipo_interesado: tipoInteresado,
                    tipo_sujeto_procesal: tipoSujetoProcesal,
                    primer_nombre: primerNombre,
                    segundo_nombre: segundoNombre,
                    primer_apellido: primerApellido,
                    segundo_apellido: segundoApellido,
                    tipo_documento: tipoDocumento,
                    numero_documento: numeroDocumento,
                    email: email,
                    telefono: telefono,
                    telefono2: telefono2,
                    cargo: profesion,
                    orientacion_sexual: idOrientacionSexual,
                    sexo: idSexo,
                    direccion: direccion,
                    departamento: departamento,
                    ciudad: ciudad,
                    localidad: localidad,
                    entidad: nombreEntidad,
                    sector: sectorEntidad,
                }}
                enableReinitialize
                validate={(valores) => {
                    let errores = {}

                    return errores
                }}
                onSubmit={(valores, { resetForm }) => {
                    enviarDatos(valores);
                }}
            >

                {({ errors }) => (
                    <Form>



                        <div className="block block-themed">
                          
                            <div className="block-content">

                                <div className='text-right'>

                                    <Link to={`/AntecedentesLista/`} title='Regresar a lista de Antecedentes' >
                                        <button type="button" className="btn btn-success"><i className="fas fa-backward"></i> </button>
                                    </Link>
                                </div>

                                <div className="row">

                                    {getLista.data.length>0?
                                        infoInteresado():AddInfoInteresado()
                                    }

                                    

                                </div>

                            </div>
                            <div className="block-content block-content-full text-right bg-light">
                                <button type="submit" className="btn btn-rounded btn-primary">Registrar</button>

                                <Link to={`/AntecedentesLista/`}>
                                    <button type="button" className="btn btn-rounded btn-outline-primary">Cancelar</button>
                                </Link>
                            </div>
                        </div>
                    </Form>
                )}
            </Formik>
        </>
    );
}


export default ComponenteMDatosInteresado;
